LTC_ARGCHK(skey != NULL);

if (keylen != 16 && keylen != 24 && keylen != 32) {

return CRYPT_INVALID_KEYSIZE;

}

skey->camellia.R = (keylen == 16) ? 18 : 24;

if (num_rounds != 0 && num_rounds != skey->camellia.R) {

return CRYPT_INVALID_ROUNDS;

}

if (keylen == 16) {

for (x = 0; x < 16; x++) {

T[x] = key[x];

T[x + 16] = 0;

}

} else if (keylen == 24) {

for (x = 0; x < 24; x++) {

T[x] = key[x];

}

for (x = 24; x < 32; x++) {

T[x] = key[x-8] ^ 0xFF;

}

} else {

for (x = 0; x < 32; x++) {

T[x] = key[x];

}

}

for (x = 0; x < 16; x++) {

kL[x] = T[x];

kR[x] = T[x + 16];

}

for (x = 32; x < 48; x++) {

T[x] = T[x - 32] ^ T[x - 16];

}

LOAD64H(A, T+32); LOAD64H(B, T+40);

B ^= F(A ^ key_sigma[0]);

A ^= F(B ^ key_sigma[1]);

STORE64H(A, T+32); STORE64H(B, T+40);

for (x = 0; x < 16; x++) { T[x+32] ^= kL[x]; }

LOAD64H(A, T+32); LOAD64H(B, T+40);

B ^= F(A ^ key_sigma[2]);

A ^= F(B ^ key_sigma[3]);

STORE64H(A, T+32); STORE64H(B, T+40);

for (x = 0; x < 16; x++) { kA[x] = T[x+32]; }

for (x = 0; x < 16; x++) { T[x+32] ^= kR[x]; }

