LOAD64H(skey->camellia.kl[3], T+40);

rot_128(kL, 94, T+32);

LOAD64H(skey->camellia.k[12], T+32);

LOAD64H(skey->camellia.k[13], T+40);

rot_128(kA, 94, T+32);

