STORE64H(A, T+32); STORE64H(B, T+40);

for (x = 0; x < 16; x++) { kB[x] = T[x+32]; }

LOAD64H(skey->camellia.kw[0], kL);

LOAD64H(skey->camellia.kw[1], kL+8);

LOAD64H(skey->camellia.k[0], kB);

LOAD64H(skey->camellia.k[1], kB+8);

rot_128(kR, 15, T+32);

